import React from "react";

const Button = () => {
  return (
    <div>
      <div className="flex">
        <button className="w-40 h-11 rounded-full bg-[#3a2350] text-white p-2 shrink-0 bg-[#7714121]">
          Enrol Now
        </button>
      </div>
    </div>
  );
};

export default Button;
